package tp4;

public class Tag {
	
	private int tagID;
	private String tag;
	
	public Tag(int tagID, String tag) {
		// TODO Auto-generated constructor stub
		this.tagID = tagID;
		this.tag = tag;
	}
	
	public int getTagID() {
		return tagID;
	}
	
	public void setTagID(int tagID) {
		this.tagID = tagID ;
	}
	
	public String getTag() {
		return tag;
	}
	
	public void setTag(String tag) {
		this.tag = tag ;
	}
}
